/**
 * Render QR code to canvas
 */
QRCode.toCanvas=function(canvas,text,options){
  options=options||{};
  var size=options.width||256;
  var margin=options.margin!==undefined?options.margin:4;
  var errorCorrectLevel=options.errorCorrectLevel||QRCode.ErrorCorrectLevel.L;

  // Create QR code with auto type detection
  var qr=new QRCode(0,errorCorrectLevel);
  qr.addData(text);
  qr.make();

  var moduleCount=qr.getModuleCount();
  var cellSize=Math.floor(size/(moduleCount+margin*2));
  var offset=Math.floor((size-cellSize*moduleCount)/2);

  canvas.width=size;
  canvas.height=size;

  var ctx=canvas.getContext('2d');

  // White background
  ctx.fillStyle='#ffffff';
  ctx.fillRect(0,0,size,size);

  // Draw modules
  ctx.fillStyle='#000000';
  for(var row=0;row<moduleCount;row++){
    for(var col=0;col<moduleCount;col++){
      if(qr.isDark(row,col)){
        ctx.fillRect(
          offset+col*cellSize,
          offset+row*cellSize,
          cellSize,
          cellSize
        );
      }
    }
  }
};
